import React from "react";
import { Watch } from "react-loader-spinner";
import "react-loader-spinner/dist/loader/css/react-spinner-loader.css";
const Spinner = () => {
  return (
    <div className="spinner">
      <Watch
        height="80"
        width="80"
        radius="48"
        color="#0d6efd"
        ariaLabel="watch-loading"
        wrapperStyle={{}}
        wrapperClassName=""
        visible={true}
        />
    </div>
  );
};
export default Spinner;
